import React from 'react'

const Card = (p) => {
    return (
        <div>
            {/* {
                console.log(p)
            } */}
            {
                p.carDetailsArray.map((n) => (
                    <div>
                        <h1>{n.title}</h1>
                        <h4>{n.content}</h4>
                    </div>
                ))
            }

        </div>
    )
}

export default Card

